import React from "react";
import { Layout, Button } from "antd";
import { Row, Col } from "react-flexbox-grid";
import Dashchart from "./components/dashchart";

const Dashboard = () => (
  <>
    <Layout style={{ margin: 20, background: "white" }}>
      <Row left="xs">
        <Col xs>
        <section style={{ marginTop: 20, width: 600, height: 300 }}>
          <Dashchart />
        </section>
        </Col>
        <Col xsOffset={20}>
        <Button size="large" type="primary" href="/addtrade">
          Add trade
        </Button>
        </Col>
      </Row>
    </Layout>
  </>
);

export default Dashboard;
